import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import axios from "axios";

const Booking = () => {
  const location = useLocation();
  const { order } = location.state || {};  // The order passed from the previous page
  const [orderDetails, setOrderDetails] = useState(order || null);
  const [error, setError] = useState(null);
  const [status, setStatus] = useState(order?.status || "Pending");  // Default status

  useEffect(() => {
    if (!orderDetails) {
      const fetchOrderDetails = async () => {
        try {
          const response = await axios.get(
            `http://localhost:8000/medical_store_app/order_details/${order.id}/`
          );
          setOrderDetails(response.data.order);
          setStatus(response.data.order.status);
        } catch (err) {
          setError("Failed to fetch order details.");
        }
      };

      fetchOrderDetails();
    }
  }, [orderDetails, order]);

  const bookOrder = async (orderData) => {
    try {
      const response = await axios.post("http://localhost:8000/medical_store_app/book_order/", orderData, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('access_token')}`, // Assuming JWT auth
        },
      });
      console.log("Order booked successfully:", response.data);
      setOrderDetails(response.data);  // Set order details from backend response
      setStatus(response.data.status); // Update status from backend
    } catch (error) {
      setError("Failed to book order.");
      console.error(error.response?.data || error.message);
    }
  };

  const updateStatus = async (newStatus) => {
    try {
      const response = await axios.put(
        `http://localhost:8000/medical_store_app/order_update/${orderDetails.id}/`,
        { status: newStatus }
      );
      setStatus(response.data.status);
    } catch (err) {
      setError("Failed to update order status.");
      console.error(err);
    }
  };

  const handleBookOrder = () => {
    if (orderDetails) {
      const orderData = {
        total_price: orderDetails.total_price,
        items: orderDetails.items.map(item => ({
          medicine_id: item.medicine_id,
          quantity: item.quantity,
        })),
      };
      bookOrder(orderData);
    }
  };

  return (
    <div style={styles.container}>
      <h1>Booking Confirmation</h1>
      {error ? (
        <p style={styles.error}>{error}</p>
      ) : orderDetails ? (
        <div style={styles.orderDetails}>
          <h2>Order Details:</h2>
          <p><strong>Order ID:</strong> {orderDetails.id}</p>
          <p><strong>Total Price:</strong> ${orderDetails.total_price}</p>
          <p><strong>Order Date:</strong> {orderDetails.date}</p>
          <p><strong>Status:</strong> {status}</p>
          <h3>Items:</h3>
          <ul>
            {orderDetails.items?.map((item) => (
              <li key={item.id}>
                {item.medicine_name} - {item.quantity} x ${item.price}
              </li>
            ))}
          </ul>
          <div style={styles.buttonContainer}>
            <button
              style={styles.confirmButton}
              onClick={handleBookOrder}
            >
              Confirm Order
            </button>
            <button
              style={styles.rejectButton}
              onClick={() => updateStatus("Rejected")}
            >
              Reject Order
            </button>
          </div>
        </div>
      ) : (
        <p>Loading order details...</p>
      )}
    </div>
  );
};

const styles = {
  container: {
    padding: "50px",
    fontFamily: "Arial, sans-serif",
  },
  orderDetails: {
    backgroundColor: "#f9f9f9",
    padding: "15px",
    borderRadius: "5px",
    maxWidth: "600px",
    margin: "0 auto",
  },
  error: {
    color: "red",
    fontWeight: "bold",
  },
  buttonContainer: {
    marginTop: "20px",
    display: "flex",
    justifyContent: "space-between",
  },
  confirmButton: {
    backgroundColor: "#28a745",
    color: "#fff",
    border: "none",
    padding: "10px 20px",
    borderRadius: "5px",
    cursor: "pointer",
  },
  rejectButton: {
    backgroundColor: "#dc3545",
    color: "#fff",
    border: "none",
    padding: "10px 20px",
    borderRadius: "5px",
    cursor: "pointer",
  },
};

export default Booking;
